func (m *CloudletManagedCluster) Matches(o *CloudletManagedCluster, fopts ...MatchOpt) bool {
	opts := MatchOptions{}
	applyMatchOptions(&opts, fopts...)
	if o == nil {
		if opts.Filter {
			return true
		}
		return false
	}
	if !m.Key.Matches(&o.Key, fopts...) {
		return false
	}
	if !m.CloudletKey.Matches(&o.CloudletKey, fopts...) {
		return false
	}
	if !m.ClusterKey.Matches(&o.ClusterKey, fopts...) {
		return false
	}
	if !opts.Filter || o.Reservable != false {
		if o.Reservable != m.Reservable {
			return false
		}
	}
	if !opts.Filter || o.MultiTenant != false {
		if o.MultiTenant != m.MultiTenant {
			return false
		}
	}
	if !opts.IgnoreBackend {
		if !opts.Filter || o.KubernetesVersion != "" {
			if o.KubernetesVersion != m.KubernetesVersion {
				return false
			}
		}
	}
	if !opts.IgnoreBackend {
		if !opts.Filter || o.RegionOrLocation != "" {
			if o.RegionOrLocation != m.RegionOrLocation {
				return false
			}
		}
	}
	if !opts.IgnoreBackend {
		if !opts.Filter || o.ResourceGroup != "" {
			if o.ResourceGroup != m.ResourceGroup {
				return false
			}
		}
	}
	if !opts.IgnoreBackend {
		if !opts.Filter || o.State != "" {
			if o.State != m.State {
				return false
			}
		}
	}
	if !opts.IgnoreBackend {
		if !opts.Filter || o.OperationalState != "" {
			if o.OperationalState != m.OperationalState {
				return false
			}
		}
	}
	return true
}

